window.ListUtils={move:function(e,n,i,r){for(var o in e)if(r==e[o][i]){n.push(e[o]),e.splice(o,1);break}},moveAll:function(e,n){for(var i in e)n.push(e[i]);e.splice(0,e.length)},removeDuplicates:function(e,n,i){for(var r in e)this.remove(n,i,e[r][i])},remove:function(e,n,i){for(var r=e.length,o=0;o!=r&&e[o];)e[o][n]==i?e.splice(o,1):++o},getIndex:function(e,n,i){for(var r=0,o=e.length;r!=o;++r)if(e[r][n]==i)return r;return-1}};